import React from "react";
import goku from "../assets/goku.jpg";

const Card = () => {
  return (
    <>
      <div>
        <div>
            <img src={goku}/>
        </div>
        <div>
            <p>Goku</p>
            <p>estamos probando el texto de la descripcion</p>
        </div>
      </div>
    </>
  );
}

export default Card;
